import {
	FETCH_COURSES,
	MESSAGE_COURSES,
	STATUS_COURSES,
} from 'constants/types/oprec';

export const statusCourses = (status) => ({
	type: STATUS_COURSES,
	payload: status,
});

export const fetchCourses = (courses) => ({
	type: FETCH_COURSES,
	payload: courses,
});

export const messageCourse = (message) => ({
	type: MESSAGE_COURSES,
	payload: message,
});
